"""# Questions

Below are 10 questions we answer through generating various SQL queries:

1. What is the average salary of Senior employees?
2. What is the maximum salary for each experience level?
3. Which waiter did not take an order?
4. Which waiter took the most orders?  How many?
5. How many chefs used more than 1 ingredient? 
6. Which presentation style is most performed by chefs?
7. What is the most commonly used equipment in a restaurant? 
8. What chefs specialize in American food?
9. Is it common for chefs not to go to culinary school? 
10. What is the average cook time (in hours) for each chef?

# Queries

Below are the queries that generate solutions for each question above:
"""

# Query 1 - What is the average salary of Senior employees?

c.execute('''  
SELECT Experience, avg(Salary)
FROM Employee LEFT JOIN Hires ON Employee.Employee_ID = Hires.Employee_ID 
WHERE Experience = "Senior"
GROUP BY Experience''')

for row in c.fetchall():
    print (row)

# Query 2 - What is the maximum salary for each experience level?

c.execute('''  
SELECT Experience, max(Salary) as Maximum_Salary
FROM Employee LEFT JOIN Hires ON Employee.Employee_ID = Hires.Employee_ID 
GROUP BY Experience''')

for row in c.fetchall():
    print (row)

# Query 3 - Which waiter did not take an order?
c.execute('''  
SELECT Waiter_ID
FROM Waiter 
Where Waiter_ID NOT IN (SELECT DISTINCT(Waiter_ID) FROM Takes)
''')

for row in c.fetchall():
    print (row)

# Query 4 - Which waiter took the most orders?  How many?

c.execute('''  
SELECT Waiter_ID, COUNT(Order_Number) as Order_Count
FROM Takes
GROUP BY Waiter_ID
ORDER BY Order_Count DESC
''')

for row in c.fetchall():
    print (row)

# Query 5 -  How many chefs used more than 1 ingredient?

c.execute('''  
SELECT COUNT(*) FROM
(SELECT Chef_ID, COUNT(Ingredient) as Ing_Count
FROM Ingredients
GROUP BY Chef_ID
HAVING Ing_Count > 1
ORDER BY Ing_Count DESC)
''')

for row in c.fetchall():
    print (row)

# Query 6 - Which presentation style is most performed by chefs?

c.execute('''  
SELECT Presentation, COUNT(Presentation) as Pres_Count
FROM Entree
GROUP BY Presentation
ORDER BY Pres_Count DESC
''')



for row in c.fetchall():
    print (row)

# Query 7 - What is the most commonly used equipment in a restaurant?
c.execute('''  
SELECT Equipment, count(Chef_ID)
FROM Entree
GROUP BY Equipment
ORDER BY count(Chef_ID) DESC
''')

for row in c.fetchall():
    print (row)

# Query 8 - What chefs specialize in American food?
c.execute('''  
SELECT Employee_ID, Chef_ID, Speciality
FROM Chef
WHERE Speciality = 'American'
''')

for row in c.fetchall():
    print (row)

# Query 9 - Is it common for chefs not to go to culinary school?
c.execute('''  
SELECT Culinary_School, count(Employee_ID)
FROM Chef
GROUP BY Culinary_School
ORDER BY count(Employee_ID) DESC
''')

for row in c.fetchall():
    print (row)

# Query 10 - What is the average cook time (in hours) for each chef? 
c.execute('''  
SELECT Employee_ID, Chef.Chef_ID, avg(cook_time)
FROM Chef LEFT JOIN Cooks ON Chef.Chef_ID = Cooks.Chef_ID 
GROUP BY Chef.Chef_ID
ORDER BY avg(cook_time) DESC
''')

for row in c.fetchall():
    print (row)

